import { useSelector } from 'react-redux';

import Layout from '../components/layout';
import Header from '../components/header';

const Cart = () => {
    const cartItems = useSelector(state => state.cart.items);

    return (
        <Layout>
            <p>Cart page</p>
            <Header />
            {
                cartItems.map(item => {
                    return (
                        <div>
                            <h1>{item.name}</h1>
                        </div>
                    )
                })
            }
        </Layout>
    )
}

export default Cart;
